import React from 'react';
import { Income } from '../types'; // Importing the Income interface
import IncomeForm from './IncomeForm';

interface IncomeProps {
  incomes: Income[];
  setIncomes: React.Dispatch<React.SetStateAction<Income[]>>;
  categories: string[];
}

const Incomes: React.FC<IncomeProps> = ({ incomes, setIncomes, categories }) => {
  return (
    <div>
      <h2>Incomes</h2>
      <IncomeForm setIncomes={setIncomes} categories={categories} />
      {/* Display incomes here */}
    </div>
  );
};

export default Incomes;
